INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンセスなプリンなの\nお店にあったいろんな食べもの\nを入れられるだけ入れてみたの\nどんな味なのか楽しみなの", "ペコリーヌのプリン", 100, "やばいですね☆なの！", 1, "おいしすぎて食べ始めたら\n止まらない最高のプリンなの\n今のミヤコを止められるヤツは\n誰もいないの", 3, 1, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("いつもオマエのそばに寄りそう\nヤツのぷりんなの。ミヤコの\nワガママもやさしく受け入れて\nくれそうなの", "コッコロのプリン", 101, "主さま、なの！", 1, "なんだかすごくやさしい気持ち\nになる味なの…\nおはようからおやすみまで\nずっと一緒な味なの…", 3, 2, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ツンツンデレデレなヤツの\nプリンなの。砂糖とスパイスを\n混ぜてみたの。どんな味になる\nか楽しみなの", "キャルのプリン", 102, "ぶっ殺すぞ！なの！\n…デレデレはどこなの？", 0, "いろんな味が一度で楽しめる\nプリンなの。ツンデレはプリン\nにするとおいしいの。ミヤコも\nツンデレを目指してみるの", 3, 3, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("オマエと同じで、一度赤ちゃん\nみたいになったヤツのプリン\nなの。ヒンヤリ、プリンアイス\nにしてみたの", "シェフィのプリン", 103, "おにーたん♪なの！", 1, "あったかいところで食べる\nプリンアイスは最高なの～♪\n安心しすぎて昔の記憶のない\nミヤコも心が子どもになるの～", 3, 4, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("イリヤを見てたら思いついた\nトマトジュースが隠し味の\nプリンなの。栄養満点なの", "イリヤのプリン", 104, "ハーハッハッハ！\n世界征服なのじゃなのー！", 1, "トマトで栄養補給も完璧なの\nどんどん力がみなぎってきて\n復活も夢じゃないの\nミヤコが復活したら…", 3, 5, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("アカリのプリンなの。ヨリと\n同じくらいかわいく作って\nやったの。正直ミヤコは\nおいしければなんでもいいの", "アカリのプリン", 105, "お兄ちゃんのエッチ！　なの！", 1, "見た目がかわいくてもミヤコは\n味にも厳しいの。あむっ…\nこ、これは…！なんだかすごく\n変な気分になってきたの…", 3, 6, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("かわいくつくらないとアカリが\n怒りそうだからヨリのプリンは\nかわいく作ったの。自信作なの", "ヨリのプリン", 106, "えっと…その…あんたのこと…\nだ、大っ嫌いなのーー！", 1, "んむぅ…これはなかなか感想が\n難しいプリンなの…率直に言い\nたいような…心のうちに秘めて\nおきたいような…", 3, 7, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("シノブはいつもミヤコに\nやさしくしてくれるから\n丁寧に作ったの。ドクロ親父は\nいらないから作ってないの", "シノブのプリン", 107, "お父さん…\nいいかげんにしてなの！\nん？プリンの未来は…\n見えなかったの…", 0, "このプリンを食べるとシノブが\nミヤコの中にいるみたいなの！\nシノブの力があれば未来の\nプリンを見放題なの！", 3, 8, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("黒い鎧を脱がないヤツのプリン\nなの。固めのプリンを目指したら\nカチカチになりすぎたの", "ジュンのプリン", 108, "インフェルノシールド！なの！", 1, "固すぎてかじれないから丸吞み\nにしたの。なんだか体が硬く\nなった気がするの。みんなを\n守れる気がするの！", 3, 9, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("オマエをいっつもからかってる\nヤツのプリンなの\nちょっぴり変わったスパイスで\nからかいを表現したの", "トモのプリン", 109, "あなたといると調子が狂うな\n…なの\n翻弄してたのはオマエなの？", 1, "口の中でスパイスがプチプチ\nはじけて新食感なの！\nプチプチがミヤコを\n翻弄するの！", 3, 10, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("王宮騎士団にいるちっこいヤツ\nなの。ちっこいけどやるヤツ\nらしいから、濃いめの味付けに\nしてみたの", "マツリのプリン", 110, "タイガーヒーローボンバー！\nなの！", 1, "ん～見かけによらず濃厚な\nパンチのある味わいが\n口いっぱいに広がるの！", 3, 11, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("なんかすごくクールなプリンなの\nなんかテンションも少し\n低そうなの。これ\n食べちゃっても大丈夫なの？", "クロエのプリン", 111, "ま、いいんじゃん？\nしらんけどなの", 1, "クールな見た目なのにとっても\n優しい味なの！なんだか\n懐かしさを感じるの…", 3, 13, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("きれいにデコれたの！\nカラフルでおいしそうなの\nこれは期待できそうなの", "チエルのプリン", 112, "ぷりーん★なの！", 1, "なんか変わった食感なの…\nちゃる…ちょる…ちぇる？\nちぇるってしてるの\nでもちぇるってなんなの？", 3, 14, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("見た目は完ぺきなの！\nこれをつくったやつは\nきっと天才なの！\n早く食べたいの！", "ユニのプリン", 113, "端的に換言すれば\n青春の味なの？", 1, "味はなんか妙に\n甘酸っぱいの…\n食べたことない味なの\nこの味ってもしかして…", 3, 15, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("オマエから聞いた懐かしい\n味ってヤツを全部入れてみたの\nオマエ記憶がないのに懐かしい\nってどういうことなの？", "サレンのプリン", 114, "幼なじみはあんた…なの？", 1, "ミヤコも幽霊になる前の記憶\nがないのに、なんだか懐かしい\n気持ちになってくるの…", 3, 16, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("たまたま会ったメイドに教えて\nもらった作り方なの。メイドは\nプリンも作れるはずなの。\nなのにこの不安は何なの…？", "スズメのプリン", 115, "ひゃああんなの～！", 1, "おかしいの。このプリンを\n食べてから、３回も転んだの\nミヤコは幽霊だから転んだり\nしないの。なんでなの…？", 3, 17, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("怖がりな子どもが教えてくれた\n小さくてかわいいプリンなの　\n触ってないのにぷるぷる震える\n驚きのやわらかさなの", "クルミのプリン", 116, "サルキデバレヤ！なの！", 0, "甘さのなかに少しのしょっぱさ\nクセになる味なの\nこのプリンはがんばればきっと\nいろんな美味しいになれるの", 3, 18, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("くまのぬいぐるみを見ていたら\nひらめいたの。小さいけど\nしっかりした甘さの元気に\nなれるプリンなの！", "アヤネのプリン", 117, "プリンフルスイングなの～！", 1, "このプリン、食べるとなんだか\nお姉ちゃんになった気分に\nなるの。ピンチのプリンは\nミヤコが守ってやるの！", 3, 19, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("マホマホ王国って国にいる\nお姫様のプリンなの\n魔物も虜にしちゃう\nすてきなプリンなの", "マホのプリン", 118, "みらくるみやりん\nくるりんぱ～☆なの！", 1, "メルヘンパワーがあふれてきて\nいまならミヤコにも魔法が\n使える気がするの！\nほな、いきまひょ～なの！", 3, 20, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("カッコいいプリンを目指して\nワイルドなものをガンガン\n入れてみたの。きっと熱い\nプリンができるはずなの", "マコトのプリン", 119, "ウルフェンバイトなの！", 1, "うおーん！ミヤコなんだか\n強くなった気がするの！\n困ったことがあればミヤコが\nまとめて面倒見てやるの！", 3, 21, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("どっかの国でよくとれる\nゴーヤーに似てるやつを\nいれてみたの！ちょっと\n苦いらしいけど…", "カオリのプリン", 120, "なんくるないさ～！なの！", 1, "一口食べたら元気が\nあふれて止まらないの！\n気分がいいから、一曲\n踊りでも披露してやるの！", 3, 22, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("勘の鋭いやつが好きな食べ物を\nたくさん入れてみたの\n難しいこと考えるのにぴったり\nらしいけど、なんでなの？", "カスミのプリン", 121, "ふふん。簡単な推理なの", 1, "むむむ…なるほどなの\n上質な糖分をふんだんに\n使うことで、脳をより活性化\nできるからなの！", 3, 23, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("搾りたての牛乳を\nたっぷり使ったプリンなの～\nマヒルに手伝ってもらって\nミヤコ直々に搾ってきたの！", "マヒルのプリン", 122, "エリザベス～！なの～！", 1, "ミルクがとっても濃厚で\nほっぺたが落ちちゃうの～♪\nこのプリンからは牧場の…\n自然の息吹を感じるの！", 3, 24, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("マヒルからやさしいヤツだって\n聞いたの。やさしさを表現\nするために奥ゆかしい甘さに\n仕上げてみたの", "シオリのプリン", 123, "私の好きな本…読んで\nもらえたらうれしいです…\nなの", 1, "ほのかな甘さでありながら\nしっかりとした主張も\n感じさせる\n味わい深いプリンなの", 3, 25, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("牧場にいるヤツらしいの\n牛とは違うらしいの\nもふもふ気持ちいいらしいから\n食感にこだわって作ったの", "リマのプリン", 124, "もふもふにしてあげるなの！", 1, "こ、これは…！口の中に入れた\n瞬間にふんわり溶けて\nなくなっちゃうの！\nその食感がやみつきなの！", 3, 26, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("いっつも寝てるやつらしいの\nぐっすり眠れる薬草をたくさん\n入れてみたの。プリンとして\nおいしくなるかはわからないの", "リンのプリン", 125, "めんどくさいな～なの…", 0, "んむぅ…評価が難しい味なの…\nおいしいのはおいしいの…\nん～考えてたら…\n眠くなってきたの…", 3, 27, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("クレープ屋の真っ赤な人に\n教わったプリンなの\n作り方を丁寧に教えてくれて\nとっても優しい人だったの！", "ラビリスタのプリン", 126, "プリンの権能を解放するの～！", 1, "プ…プリンなのにクレープの味\nがするの。味もすごく普通なの\nでも…なんだかプリンの新しい\n扉を開けそうな気がするの…！", 3, 28, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お店に落ちてた謎のレシピの\nプリンなの。レシピの表紙には\n『お姉ちゃんの愛情たっぷり』\nって書いてあったの", "シズルのプリン", 127, "お姉ちゃんパワー全開！なの！", 0, "とろける食感が絶品なの～♪\n食べるとなんだか幸せな\n気持ちになれるの…これが\n愛情ってやつなの？", 3, 29, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("リノから作り方を教わったの！\nさすがクレープ屋で働いてる\nだけあって美味しそうなの！", "リノのプリン", 128, "お兄ちゃん、プリンをよこすの！", 1, "これで妹力？があがるらしいの。\n妹になればお兄ちゃんに\nプリンをたかり放題なの！\n最高なの～！", 3, 30, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンのレシピで悩んでたら\n通りすがりのおねーさんが\n一緒に考えてくれたプリンなの\nいいヤツもたまにはいるの～♪", "ヒヨリのプリン", 129, "困った時はお互いさまさま！\nなの！", 1, "食べたら元気が湧いてくるの\nだからプリンのレシピのお礼に\nミヤコも人助けを手伝って\nやったの。ミヤコはえらいの！", 3, 31, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ミヤコががんばって作った\nこだわりのプリンなの～\nプリンは癒しなの。だから優しい\n気持ちで丁寧に作ったの", "ユイのプリン", 130, "フラワリングヒールなの～♪", 1, "はっ…思わずお花畑が見えたの\n身も心も包まれるような\nとっても優しい味がするの\nこれは…まさに癒しなの～♪", 3, 32, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("究極のプリンを作るため\nミヤコは厳しい修行をしたの…\nその結果あって完成した\nクールで完璧なプリンなの！", "レイのプリン", 131, "スラッシュテンペスト！なの。", 1, "確かに完璧なプリンなの\nでも究極のプリンと呼ぶには\nまだまだ修行が必要なの…\nプリン作りは奥が深いの…！", 3, 33, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("豪華で高級な\nお嬢様プリンなの\n中には宝石みたいな\n大きいイチゴを入れるの！", "アキノのプリン", 132, "おーほっほほほ！なの！", 1, "味にも素材にもこだわりが\nあるの。一流は妥協しないの\nもっと豪華に、もっとおいしく\nできるはず…", 3, 34, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("外はしっかり、中はふわとろの\nプリンにするの\n泡みたいなしゅわしゅわの\n生クリームも入れるの♪", "ユカリのプリン", 133, "プリしゅわ最高～！なの！", 1, "プリンは飲み物とも言うの\nぐいっていってみるの\n…ふわしゅわでとろけるの～！\n体に染みわたるの～", 3, 35, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("餡子を入れて\nオーブンでこんがり焼くの\nたい…焼きプリンなの\n斬新なの！", "タマキのプリン", 134, "にゃにゃにゃ！なの！", 1, "このプリンは焼きたてのうちに\n食べるのが一番なの…！\n熱いけどおいしくて\nうずうずしてきたの…！", 3, 36, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("栄養バランスを考えて\n木の実をたくさん入れるの\nあれこれ忙しいときでも\n頼りになるプリンなの！", "ミフユのプリン", 135, "効率全開！なの！", 0, "プリンはいつでも手軽に\n食べられるのも魅力なの\nこれは食べ応えもあるから一つ\n食べればいっぱい動けるの", 3, 37, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("エルフの森で子どもにもらった\n薬草を使って作ったの\nこんな優しい味のプリンは\n初めてなの…", "ミサトのプリン", 136, "あらあら～なの～♪", 1, "このプリンを食べてから\nいい子になった気がするの\n大好きなプリンを泣いてる子に\nあげたの。いい気分なの", 3, 38, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お昼寝でみた夢の中に\nでてきた不思議なプリンを\n作ってみたの。見てたらまた\n眠くなってきたの…", "ハツネのプリン", 137, "スヤスヤ～…なの…", 1, "あまいプリンが口の中で\nぽんぽん弾ける未知の味なの！\n今なら不思議な力で世界も\n救えそうなの！でも眠くなるの…", 3, 39, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("お店のはしっこに一つだけ\n残ったおもちゃを見て思い\nついたの。他のプリンと一緒に\n置いておくと震えだすの", "アオイのプリン", 138, "ぼっちは卒業なの～！", 1, "知らないうちにはしっこに\n隠れちゃってたの。食べたら\nミヤコ、シノブたちに会いに\nいきたくなってきたの", 3, 40, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("トップオブアイドルの\nプリンなの。キラキラした\nものを入れて、あつ～い\nオーブンで焼いてみたの", "ノゾミのプリン", 139, "リズムあげるのー！", 1, "口の中に華やかな甘さが\n広がる…これがアイドルなの？\n急に歌って踊りたく\nなってきたの！", 3, 41, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ミヤコにプリンをくれるすごく\nいいヤツのプリンなの\n精霊に呼びかけながら\n一生懸命かき混ぜたの", "チカのプリン", 140, "風の加護を！なの！", 1, "プリンの生地がとっても\nなめらかで最高の舌触りなの！\n精霊、ミヤコのプリンのために…", 3, 42, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("歌って踊って衣装も作れるヤツ\nのプリンなの。このプリンは\nきれいに包装するの。プリンを\n最高の形で着飾らせるの", "ツムギのプリン", 141, "騎士さんのために\nしたんじゃありません！なの！", 1, "包装は食べるまでの手間が\n増えてめんどくさいの。でも\nそのめんどくささもプリンの\n味を引き立てるの", 3, 43, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("プリンをくれないならどうでも\nいいヤツなの。でも横で\nいろいろ言ってきたから\nがんばって作ったの", "クリスティーナのプリン", 142, "宴の始まりなの！", 0, "んむっ！？\nく、口のなかでプリンの\nおいしさが大暴れなの！\n止まらないの！", 3, 12, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("大人な甘さ控えめのプリンを\n作るの。試しにお魚を入れて\nみるの。プリンの可能性は\n無限大なの！", "ルカのプリン", 143, "一刀両断、覚悟しな！なの！", 1, "大人の味なの。今やミヤコは\nみんなの頼れる姐御なの！\n悪さするやつはミヤコが\n許さないの！", 3, 44, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("サイカワサイツヨな\n魔法のプリンなの\n中身をカラフルにするの～\n甘いプリンは頭が冴えるの！", "ナナカのプリン", 144, "きゅぴーん！キタコレ！なの！", 1, "一口食べる度に味が変わって\n魔法みたいなの！\nもしかして全部食べたら\nミヤコも魔法少女になれるの？", 3, 45, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("小難しい言葉をささやきながら\n作ったら魔力あふれるプリンが\n爆誕したの！でも、不思議と\nイタイタしいのはなぜなの～？", "アンナのプリン", 145, "人呼んで、疾風のミヤコなの！", 1, "一口食べたら謎の組織に\n狙われたり、前世の記憶が蘇る\n気がするの～設定盛りすぎなの\nミヤコは、ミヤコは…", 3, 46, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("甘酸っぱい赤い木の実を\n切り刻んで入れるの\n甘くてちょっぴり刺激的な\nヤンデレのプリンなの", "エリコのプリン", 146, "クスクス…クスクスクス…なの", 1, "なんか普通のプリンよりも\nいい匂いがするの～…\nプリンのことがもっともっと\n好きになっちゃうの…", 3, 47, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("健康に気を遣うミヤコは\nプリンにお薬を入れてみたの～\nでもなんだか毒々しいから\n彩りにバラを添えてみたの～", "ミツキのプリン", 147, "どんなプリンも\nミヤコの隻眼からは\n逃れられないの～！", 1, "鼻に抜ける薬のにおいがアレ\nだけど大人っぽくて頭が\nよくなった気がするの。無性に\n実験したくてしかたないの", 3, 48, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("小さいけどしっかりした\n軍人のプリンなの\nちょっと固めにして\n砂糖はいっぱい入れるの", "モニカのプリン", 148, "私は子どもではない！なの！", 1, "ん～王道なプリンは\n甘くて安定したおいしさなの～\n思わず笑顔になっちゃうの\nにこにこなの～♪…はっ！", 3, 49, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("オーエド町で手に入れた素材と\nトーゴクに伝わる術をかけて\nプリンを作るの。シュババ！\n忍法隠し味の術なの！", "ニノンのプリン", 149, "ショーグン！　ミヤコと一緒に\n天下統一するデースなの！", 1, "このプリンを食べてから\n誰かにお仕えしなきゃ\nいけない気がするデースなの\nそれはショ、ショー…", 3, 50, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("オマエが持ってきた手錠を\nヒントに作ったプリンなの\nプリンが動けないように\nカチカチに固めたの", "クウカのプリン", 150, "…ぐふふ、じゅるり～なの", 0, "カチカチに固めたせいで食感が\nプリンのようで\nプリンじゃないの…でもこの\nもどかしさが癖になるの…", 3, 51, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("とっても美しいプリンなの\n美しいものを手当たり次第\n入れたらすごいことになったの", "ユキのプリン", 151, "あぁ、ミヤコはなんて美しいの～", 1, "味も美しい以外の感想が\n出てこないの。ていうかこれを\n食べたミヤコも美しいの！\n鏡、鏡はどこなの！", 3, 52, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("知らないうちにお菓子が売れた\n時に思いついたプリンなの。\n作り方もよく覚えてない…\nけど、きっとおいしいの！", "アユミのプリン", 152, "ジー…ってミヤコなにしてるの\nミヤコはストーカーじゃないの！", 0, "うん、やっぱりおいしく…\nん？あそこにいるのは\nアイツなの。あれ？\n体が勝手にアイツの方に…", 3, 53, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("イタズラ好きの手下と一緒に\n作ったプリンなの。見た目は\nかわいいけど、作り方は\n意外と複雑なの～", "ミソギのプリン", 153, "にひひ…イタズラの時間なの！", 0, "見た目通り甘々で優しい味なの\nでも、レシピを見たら裏面に\n別の作り方が書いてあるの。\nこれだと激辛プリンに…", 3, 54, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("素直でやさしい手下と一緒に\n動物のぬいぐるみをいっぱい\n並べて作ったの", "ミミのプリン", 154, "ぴょんぴょこぴょーん、なの♪", 0, "ん～、ふわふわの甘々なの！\nなんだか楽しくなって\n心も体もるんたったしてくるの", 3, 55, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("幽霊を怖がっている手下と\n一緒に作ったプリンなの。\n小さいクセにきっちりしてて\nとってもかわいいプリンなの", "キョウカのプリン", 155, "へんたいふしんしゃさんなの！", 0, "ひんやりしてて暑い日でも\nおいしく食べられそうなの！\nん？これを買いたい大人が\nいる？それって…", 3, 56, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("カリスマモデルなプリンなの\nモリモリにデコレーションして\nカリスマ感を演出したの", "スズナのプリン", 156, "ハート狙い撃ち！なの！", 1, "見て食べて楽しめる新機軸の\nプリンなの。ミヤコは幽霊\nだけど自分の足でランウェイを\n歩きたくなってきたの！", 3, 57, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("学校の先生をしてるヤツの\nプリンなの。お堅くしようと\nしたら、いつの間にか色っぽく\nなっちゃったの。なんでなの？", "イオのプリン", 157, "授業を始めます♪なの！", 0, "プ、プリンは全部ミヤコのもの\nなのに、なんだかこのプリンは\nいろんな人に教えたく\nなっちゃう不思議な味なの！", 3, 58, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("少し背伸びしたおませな子を\n表現したプリンなの。あえて\n甘さ控えめなの。カラメルは\n後乗せできるから安心するの", "ミサキのプリン", 158, "立派なレディ、なの！", 1, "ミヤコはプリンならどんなもの\nでも食べるの。でもカラメルを\nちょっとだけ足すの。\nちょっとだけなら…", 3, 59, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("謎に包まれたプリンができたの\n何か隠してるようなの…\nこれは危険なプリンなの！", "ホマレのプリン", 159, "プリンを持ってこないと\nお仕置きだよ～☆なの！", 1, "味はすごいゴージャスなの！\nボスの風格があるの！\nビッグなミヤコに\nプリンを捧げるの！", 3, 60, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("ワイルドな見た目なの！\nこれは期待できそうなの。\nきっと躍動感あふれる味なの！", "カヤのプリン", 160, "たぎってきたの！", 1, "最初の一口目が\nすごいインパクトなの！\n無性にケンカしたくなるの！\nプリンをよこせなの！", 3, 61, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("なんか見た目がパッとしないの\nこれほんとに大丈夫なの？\nなんか頼りないの…", "イノリのプリン", 161, "下剋上、やってやるですなの！", 0, "見た目はアレだけど味はおいし\nいの…あと主張もはっきりして\nるの！やる気と自信だけは\n出てきたのうおおおーなの！", 3, 62, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("天下の大悪党のプリンなの\nこれまでのジョーシキに\n捉われないプリンを\n作ってみたの～", "ムイミのプリン", 162, "どけどけ～！なの～！", 1, "むむむ…食べたら\nやる気が湧いてきたの！\nミヤコを邪魔するやつはみんな\nまとめてぶっ飛ばしてやるの～", 3, 63, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("いろんなものに変身したり\n分身したりできるヤツの\nプリンなの。型で同じプリンを\nたくさんたくさん作ったの", "ネネカのプリン", 163, "ミラーミラー！なの！", 1, "いつのまにか作ったの全部\n食べちゃったの。なんで\nプリンは分身しないの？\n無限に増えろなの！", 3, 64, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("金の亡者のプリンなの\n金にものを言わせて作って\nみたの。おばあちゃんの\nプリンと対極なの", "クレジッタのプリン", 164, "プリンに忠誠を誓いますわ！\nなの！", 1, "むぅ…認めたくないけど\nおいしいの…これを何個も\n作れるほどのお金を稼ぐのは\n大変なの…でもおいしいから…", 3, 65, 5);
INSERT INTO `v1_0e73c6548040b134fd6a8d53f7a16ce7e640a5d392715fb7ea86b55d96bf87d2` VALUES ("みんなお世話になるギルド\n管理協会職員のプリンなの\nお役所感を出すために手堅く\n王道に作ったの", "カリンのプリン", 165, "ギルド管理協会へようこそ！\nなの！", 1, "手堅い…！手堅いの…！\n隙のないプリンなの！\n今のミヤコなら完璧な\n書類作成ができそうなの！", 3, 66, 5);
